import Axios from 'axios';
import React from 'react';
import './App.css';

function App() {
  let data = []

  Axios.get("http://localhost:8080/chat/rooms")
  .then(response=>{
    data = (response.data)
  })

  return (
    <div className="App">
        <div>{data.map(p => <h4>{p.name}</h4>)}</div>
    </div>
  );
}

export default App;
